import React from 'react';

const VideoDetail = ({selectedVideo}) => {
    if(selectedVideo) {
        return (
            <div>
                <img src={selectedVideo.snippet.thumbnails.medium.url} alt={selectedVideo.snippet.title} />
                <div></div>
            </div>
        )
    } else {
        return (
            <div>No video selected</div>
        )
    }

}

export default VideoDetail;
